column4:
산책겸 들리기 좋아요! 안에 식당도 있어서 식사도 되는데 가격은 비싸요 양도 적구요 ㅠ 개인적으로 짜장면이 꾸덕해서 존맛,,  창가에 
앉으면 좋은 뷰 보면서 식사할 수 있어요 크진않지만 가볍게 한바퀴 돌기좋아요 계신분들 연령대가 다 높으시네요ㅎㅎ  20-30대가 오
긴 좀 올드할 수 있어요^^;

귀찮아서 리뷰 잘 안다는데 내돈 내고 기분 나빠서  처음 달아봄.. 일단 최악이였음.  고기자체가 맛없으며,육회는 걍 뷔페육회임;; 부수
적인게 맛있어야하지만 상태들이 다 메롱이였음.;; 양파 말라있고 상추말라있고 고추짱아치도 맛없음, 걍 밑반찬 다별로;;엄청 부실함;; 
우삼겹은 불판이 바뀌어서 못먹는다고 보면됨 (달라고하면 줌) .마지막 계산한뒤 영수증보니까 상차림비까지 받네...;;;;;;;;절대로...

맛있었어요~
먹다보니 조금 느끼해서 중간에 탄산음료 마셨는데 9,000원이라 별하나뺐어요...
너무 비싸요..워커힐이라 어쩔수없지만;;

매번 먹어도 너무 맛있어요
재료며 가격이며 사장님께서는 남는게 있으신지..;;
강력추천!

탕수육이 너무 별로였어요;
주문 즉시 튀길수없는건 이해하지만
정도가 좀 심한거같았어요..
